def species_type(node):
    """
    This function uses a file with all transcript list and return the 
    transcripts in a list format data.
    """
    species = ""
    if "CGAT" in node:
        species = "HS"
    elif "CGAMUST" in node:
        species = "MM"
    elif "CGACAFT" in node:
        species = "CAF"
        
    elif "ENSCAFT" in node:
        species = "CAF"
    elif "ENSMUST" in node:
        species = "MM"
    else:
        species = "HS"
    
    return species

